import React, { Component } from 'react';
import Die from './Die';

const diceNumArray = ['one', 'two', 'three', 'four', 'five', 'six']

class RollDice extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <div className="RollDice-wrapper">
                    <Die num={diceNumArray[0]}/>
                    <Die num={diceNumArray[2]}/>
                </div>
                <div>
                    <button className="RollDice-button">Roll Dice!</button>
                </div>

            </div>
        )
    }
}

export default RollDice;
